DROP TABLE IF EXISTS AGENCY_POSTCODE_RANGE;
DROP TABLE IF EXISTS AGENCY_TOPIC;
DROP TABLE IF EXISTS AGENCY;
DROP TABLE IF EXISTS DIOCESE;

DROP SEQUENCE IF EXISTS SEQUENCE_AGENCY_POSTCODE_RANGE;
DROP SEQUENCE IF EXISTS SEQUENCE_AGENCY_TOPIC;
DROP SEQUENCE IF EXISTS SEQUENCE_AGENCY;

create table DIOCESE
(
    ID          bigint       not null,
    TENANT_ID   varchar(100) null,
    NAME        varchar(100) not null,
    ID_OLD      bigint       null default null,
    CREATE_DATE timestamp,
    UPDATE_DATE timestamp,
    primary key (ID)
);

create table AGENCY
(
    ID              bigint        not null,
    TENANT_ID       varchar(100)  null,
    DIOCESE_ID      bigint        not null,
    NAME            varchar(100)  not null,
    DESCRIPTION     varchar(2600) null     default null,
    POSTCODE        varchar(5)    null     default null,
    CITY            varchar(100)  null     default null,
    IS_TEAM_AGENCY  tinyint       not null default 0,
    CONSULTING_TYPE tinyint       null     default 0,
    IS_OFFLINE      tinyint       not null default 0,
    URL             varchar(500)  null     default null,
    IS_EXTERNAL     tinyint       not null default 0,
    ID_OLD          bigint        null     default null,
    AGE_FROM        smallint      null     default null,
    AGE_TO          smallint      null     default null,
    GENDERS         varchar(50)   null     default null,
    CREATE_DATE     timestamp,
    UPDATE_DATE     timestamp,
    DELETE_DATE     timestamp     null     default null,
    primary key (ID),
    foreign key (DIOCESE_ID) references DIOCESE (ID)
);
CREATE SEQUENCE SEQUENCE_AGENCY
    START WITH 100000
    INCREMENT BY 1;

create table AGENCY_POSTCODE_RANGE
(
    ID            bigint     not null,
    TENANT_ID     varchar(100)  null,
    AGENCY_ID     bigint     not null,
    POSTCODE_FROM varchar(5) not null,
    POSTCODE_TO   varchar(5) not null,
    CREATE_DATE   timestamp,
    UPDATE_DATE   timestamp,
    primary key (ID),
    foreign key (AGENCY_ID) references AGENCY (ID)
);
CREATE SEQUENCE SEQUENCE_AGENCY_POSTCODE_RANGE
    START WITH 100000
    INCREMENT BY 1;

create table AGENCY_TOPIC
(
    ID            bigint     not null,
    AGENCY_ID     bigint     not null,
    TOPIC_ID      bigint     not null,
    CREATE_DATE   timestamp,
    UPDATE_DATE   timestamp,
    primary key (ID),
    foreign key (AGENCY_ID) references AGENCY (ID)
);
CREATE SEQUENCE SEQUENCE_AGENCY_TOPIC
    START WITH 100000
    INCREMENT BY 1;



