INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (17, null, 'Suchtfachambulanz Donauwörth (Cafè Connection)', 'Information, Beratung und Behandlung bei Problemen mit legalen und illegalen Drogen, sowie nichtstoffgebundenen Süchten (z.B. pathologischer Internetkonsum, Automatenspiel, Essstörungen) Zielgruppe: Betroffene, Angehörige. Tätigkeitsbereich: Vorbereitung und Vermittlung von ambulanten und stationären Entwöhnungsbehandlungen, Durchführung von ambulanter ehabilitation, Nachsorge, Frühintervention bei jungen SuchtstoffkonsumentInnen, Präventionsveranstaltungen, Selbsthilfe Elternkreis. Die Suchtfachambulanz bietet über die Homepage das Café Connection eine anonyme Einzel,-  und Gruppenchatberatung an.', '86609', 'Donauwörth', 0, 0, 0, null, 0, 7027, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 5);
