INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (19, null, 'Suchtberatungs- und Behandlungsstelle, Augsburg', 'Kurzbeschreibung:  Information, Beratung und Behandlung bei Problemen mit Alkohol,Medikamenten und nichtstoffgebundenen Süchten (z.B. pathologisches Spiel) Zielgruppe:  Betroffene,Angehörige,sonstige Bezugspersonen (z.B.Arbeitgeber),Selbsthilfegruppen Tätigkeitsbereich:  Vorbereitung und Vermittlung von ambulanten und stationären Entwöhnungsbehandlungen, Durchführung von ambulanter ehabilitation, Nachsorge (nachstationäre ambulante Weiterbehandlung), Vermittlung ergänzender Hilfen, Durchführung spezifischer Angebote (z.B. Gruppen für alkoholauffällige Kraftfahrer, Beratung bei Magersucht, Bulimie,Übergewicht für Erwachsene, betriebliche Präventionsveranstaltungen.  Beschreibung:  Wir sind eine durch die Kostenträger anerkannte Einrichtung für die medizinische ehabilitation bei Suchterkrankungen. ', '86152', 'Augsburg', 0, 0, 0, null, 0, 7023, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 5);
