INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (21, null, 'Caritas - Fachambulanz für Suchtkranke Bad Reichenhall', 'Die Caritas - Fachambulanz Berchtesgadener Land ist eine Beratungsstelle für jegliche Art von Suchterkrankungen. Die Beratung ist kostenlos. Bei einer ambulanten Behandlung übernimmt die Kosten der jeweilige Versicherungsträger, bei speziellen Maßnahmen, wie z. B. Schulung für alkoholauffällige Kraftfahrer, fallen Kursgebühren an.', '83435', 'Bad Reichenhall', 0, 0, 0, null, 0, 7007, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 19);
INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (22, null, 'Fachambulanz für Suchterkrankungen', 'Wir beraten und informieren suchtgefährdete und suchtkranke Menschen sowie deren Angehörige bei Suchtproblemen mit Alkohol, Medikamenten, illegale Drogen und nichtstoffgebundenen Süchten.<br><br>Darüber hinaus vermitteln wir in stationäre Behandlung, unterstützen durch Betreuung und Begleitung im ahmen des Ambulant Betreuten Einzelwohnens und/oder im ahmen der Substitutionsbehandlung. Zudem bieten wir die Möglichkeit zur ambulanten Therapie bei Suchtmittelabhängigkeit sowie zur Nachsorge im Anschluss an eine stationäre Entwöhnungsbehandlung.', '82256', 'Fürstenfeldbruck', 1, 0, 0, null, 0, 7002, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 19);
INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (23, null, 'Fachambulanz für Essstörungen', 'Beratung, Ernährungsberatung, Vermittlung und Behandlung,<br>Anorexie, Bulimie, Übergewicht und starkes Übergewicht,<br>Multiplikatoren-Schulungen, In-House-Schulungen', '80634', 'München', 1, 0, 0, null, 0, 6997, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 19);
INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (24, null, 'Suchtberatung Müllheim', 'Unser Angebot richtet sich an alle die legale Suchtmittel konsumieren, missbrauchen oder abhängig sind. Ebenso Beraten wir Bezugspersonen (Eltern, PartnerInnen, FreundInnen) und bei beruflichen oder privaten Fragen zu Suchtmitteln, Konsum und Abhängigkeit. Spezielle Angebote kurz notiert: Einzel- und Gruppengespräche im Bereich Beratung, Behandlung und Nachsorge/ Vorbereitung auf die MPU/ aucherentwöhnungskurse. In der Außenstelle in 79206 Breisach besteht an zwei Tagen die Möglichkeit Gesprächstermine zu vereinbaren.', '79379', 'Müllheim', 0, 0, 0, null, 0, 6990, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 11);
