INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (62, null, 'Psychosoziale Beratungs- und Behandlungsstelle, Dortmund', 'Information, Beratung und Behandlung von Personen mit Problemen im Umgang mit Alkohol, Medikamenten oder Glücksspiel.Die Suchtberatung bietet von Abhängigkeit betroffenen oder gefährdeten Personen sowie deren Angehörigen ein individuelles, auf sie zugeschnittenes Informations-, Beratungs- - und falls erforderlich - Behandlungsangebot an.Die Beratung kann in Form von Online-Beratung erfolgen oder bei uns vor Ort in Form von Einzel-, Paar- und Familiengesprächen. Wir bieten unterschiedliche Therapie- und therapievorbereitende Gruppen an. Wir vermitteln auf Wunsch in stationäre ehabilitationseinrichtungen (Fachkliniken) und bieten für Alkohol-/ Medikamentenabhängige sowie für pathologische GlücksspielerInnen ambulante ehabilitation in unserem Hause an. Zur Weiterbehandlung nach stationärer ehabilitation bieten wir die Möglichkeit der ambulanten Nachsorge. Wir kooperieren eng mit der Schuldnerberatungsstelle des SKM in Dortmund.', '44137', 'Dortmund', 0, 0, 0, null, 0, 6716, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 21);
