INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (78, null, 'Psychosoziale Beratung und Behandlung, Passau', 'Beratung und Behandlung bei einer Abhängigkeit von Alkohol, illegalen Drogen oder Medikamenten, zudem bei Essstörungen oder Spielsucht. Die Beratung und Behandlung wird auch für Angehörige angeboten. Ebenso gehören stationäre Vermittlungen, sowie die ambulante ehabilitation nach einer stationären Therapie zu unserem Aufgabengebiet.  ', '94032', 'Passau', 0, 0, 0, null, 0, 7063, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 22);
INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (79, null, 'Fachambulanz für Suchtprobleme Kelheim', '<b>Wege aus der Abhängigkeit - suchtfrei leben</b><br><br><b>Wer kann zu uns kommen?</b><br><br>Personen, die Probleme im Umgang mit Alkohol, Medikamente und Drogen haben, <br>Angehörige,<br> Personen mit problematischem Spielverhalten, <br>Personen mit Essstörungen, <br>Multiplikatoren. <br><br><b>Die Fachambulanz arbeitet</b><br><br>offen für alle, <br>kostenfrei,<br>auf freiwilliger Basis, <br>auf Wunsch anonym, <br>dem Datenschutz verpflichtet, <br>nur in Absprache mit dem atsuchenden, <br>nach den Grundsätzen des Leitbildes und Qualitätsleitlinien der Caritas. <br><br><b>Unsere Angebote</b><br><br>Wir beraten und informieren. <br>Wir unterstützen Sie bei Kontakten zu Behörden, wie Arbeitsamt, Jugendamt, Krankenkassen und entenversicherungsträgern. <br>Teilnahme an ambulanter Behandlung und Nachsorge in Gruppen- und Einzelgesprächen. <br>Wir vermitteln Sie in ein Fachkrankenhaus und übernehmen die Beantragung und egelung der Kostenfrage. <br>Wir informieren Sie über Selbsthilfegruppen. <br>Wir beraten Sie im ahmen einer Bewährungsauflage. <br>Ohrakupunktur nach dem NADA-Protokoll. Die Ohrakupunktur kann ergänzend bei der Behandlung von Suchterkrankungen angewendet werden. <br>SKOLL - Selbstkontrolltraining. Bundesmodellprojekt, welches in Gruppenform angeboten wird. <br>Kompetenznetzwerk Glücksspielsucht. Beratung Pathologisches Glückspiel. <br>Angehörigengruppe. <br>Gemeinsam-Aktiv-Gruppe<br><br><b>Kosten </b><br><br>Für den Klienten entstehen keine Kosten', '93309', 'Kelheim', 1, 0, 0, null, 0, 7061, '2018-12-11 10:19:13', '2019-06-24 12:53:58', null, 23);
