INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (302, null, 'Caritasverband für die Diözese Augsburg e.V., Sozialpsychiatrie', 'Die Sozialpsychiatrischen Dienste des Caritasverbandes für die Diözese Augsburg mit den Standorten   -  Augsburg-Land  -  Günzburg  -  Neu-Ulm  bieten fachliche Beratung für Menschen mit psychischer Erkrankung oder Belastung sowie für deren Angehörige.    Wir sind für Sie da...     - wenn Sie unter psychischen Belastungen und Veränderungen im seelischen Erleben leiden, wie z. B. Ängsten, Depressionen, Zwangsvorstellungen, Schlafstörungen, Verfolgungsgefühlen, Selbstwertproblemen, Überforderungserlebnissen usw.   - wenn Sie wegen einer psychischen Störung, Erkrankung oder Behinderung in persönliche, familiäre, berufliche oder soziale Schwierigkeiten gekommen sind   - wenn Sie sich aufgrund von Verlusten oder Konflikten in einer schweren seelischen Krise befinden   - wenn Sie sich isoliert und verzweifelt fühlen oder wenn Ihnen Ihre Lebenssituation ausweglos erscheint   - wenn Ihnen die psychische Erkrankung oder Behinderung eines Angehörigen, Bekannten oder Kollegen zum Problem wird   - wenn Sie sich über psychiatrische Störungen, Krankheitsbilder und Behandlungsmöglichkeiten informieren wollen  ', '86152', 'Augsburg', 0, 8, 0, null, 0, 11019, '2019-08-22 10:57:50', '2019-08-22 10:57:50', null, 5);
