INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (304, null, 'CAB Behindertenhilfe', 'Die CAB ist ein modernes, soziales Dienstleistungsunternehmen: In 22 Einrichtungen bieten wir alten Menschen und erwachsenen behinderten Menschen Hilfe an. CAB steht für  Caritas Augsburg Betriebsträger gGmbH , das kleine  g  für gemeinnützig.     Richtschnur für unser unternehmerisches Handeln ist das Bekenntnis zur christlichen Caritas. Gemäß unserem Leitbild steht der Mensch im Mittelpunkt unseres Handelns. Unsere Einrichtungen erbringen die notwendigen Dienste und Dienstleistungen gegenüber dem Hilfesuchenden um des Menschen willen, nicht aus Gründen des Gewinnstrebens.      Dienstleistung in diesem Zusammenhang heißt für uns:    Wir achten den Menschen mit Behinderung, seine Würde, sein Wohl und seine Autonomie.    Wir beachten, begleiten und fördern seine persönliche Entwicklung in allen körperlichen, seelischen und geistigen Dimensionen und Fähigkeiten umfassend.    Die Werte  Personalität ,  Individualität  und  Normalisierung  setzen wir in der Betreuung um und realisieren sie.', '86153', 'Augsburg', 1, 8, 0, null, 0, 11182, '2019-08-22 10:57:50', '2019-08-22 10:57:50', null, 5);
