INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (396, null, 'Beratungsstelle Bocholt, Rhede, Isselburg', 'Die Beratungsstelle ist Ansprechpartner für Eltern bei Erziehungs- und Entwicklungsfragen sowie für Fragen von Kindern, Jugendlichen und jungen Erwachsenen.  Eltern, Bezugspersonen, (pädagogische) Fachkräfte sowie Kinder und Jugendliche selbst sind uns herzlich willkommen.    Was tun, ...  wenn mein Kind keine Freunde findet?  ... wenn ich unsicher bin, ob mein Kind altersgemäß entwickelt ist?  ... wenn mein Kind viele Ängste zeigt?  ... wenn mein Kind sich nichts mehr sagen lässt?  ... wenn man unsicher ist, ob ein Kind die Trennung der Eltern verkraftet?    Auch Kinder, Jugendliche und junge Erwachsene haben manchmal Fragen oder Probleme, die sie mit jemand außerhalb der Familie besprechen wollen. Daher könnt ihr Euch - auf Wunsch auch ohne Eure Eltern - bei uns beraten lassen.    Ebenso beraten und coachen wir pädagogische Fachkräfte aus Kitas, Familienzentren, Schulen und anderen Einrichtungen, die Kinder und Jugendliche betreuen.    Wir bieten an, gemeinsam Lösungen zu entwickeln.  Die psychologischen und pädagogischen Fachkräfte unserer Beratungsstelle unterstützen Sie/Dich gerne, um Antworten und Lösungen für solche und andere Fragen   zu finden.    Der erste Kontakt erfolgt durch eine telefonische oder persönliche Anmeldung im Sekretariat der Beratungsstelle.  Innerhalb von 14 Tagen nach der Anmeldung gibt es einen Erstberatungstermin.    Unsere Hilfen sind für Ratsuchende kostenfrei.   Alle Gesprächsinhalte sind streng vertraulich und unterliegen der Schweigepflicht.    Termine finden nach Absprache in den Räumen der Beratungsstelle oder bei Bedarf außer Haus statt.    Wir freuen uns auf Ihren/Deinen Anruf oder Besuch!    Sprechzeiten: Mo.-Fr. 08:00 - 12:30, Mo.-Do. 14:00 -17:00 Uhr, sowie nach Vereinbarung  ', '46399', 'Bocholt', 0, 3, 0, null, 0, 7372, '2019-08-22 11:10:30', '2019-08-22 11:10:30', null, 2);
