INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (451, null, 'Caritas Beratungsstelle für Eltern, Kinder, Jugendliche und Familien, München Hansastrasse 136', 'Im Rahmen der Onlineberatung werden Erstkontakte (Mo - Do bis 16 Uhr ) innerhalb von 48 Stunden beantwortet; Emails, die in der Woche nach Donnerstag 16 Uhr die Stelle erreichen (also auch Fr, Sa, So) werden bis Montag 16 Uhr beantwortet.  Die Beratungsstelle ist vorrangig zuständig für Ratsuchende aus den Münchner Stadtteilen Sendling, Sendling-Westpark, Groß- und Neuhadern.   Ein Team bestehend aus neun qualifizierten Fachkräften (Diplom-PsychologInnen, Diplom-SozialpädagogInnen und Diplom-PädagogInnen) bietet Beratung für Eltern, Kinder, Jugendliche und Familien sowie weitere Bezugspersonen von Kindern und Jugendlichen an. Auch pädagogische Fachkräfte können sich an die Beratungsstelle wenden.  Ratsuchende mit Fragen hinsichtlich der Entwicklung von Kindern und Jugendlichen, bei Schwierigkeiten in Beziehungen (in der Familie oder im Umfeld), bei Schulproblemen oder bei Fragen im Zusammenhang mit Trennung und Scheidung werden anonym, vertraulich und kostenfrei sowie unabhägig von Konfession oder Weltanschauung beraten.  Darüber hinaus bietet die Stelle Elterngruppen sowie Informationsveranstaltungen für Fachleute an.', '81373', 'München', 0, 3, 0, null, 0, 7632, '2019-08-22 11:10:30', '2019-08-22 11:10:30', null, 19);
