INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (506, null, 'Caritasverband Nürnberg e.V.   Psychologische Beratungsstelle für Eltern, Kinder und Jugendliche', 'Beratung und Therapie bei familiären, Erziehungs- und Beziehungsproblemen   Beratung für Mütter und Väter bei Fragen zu Partnerschaft, Trennung und Scheidung   Psychodiagnostik (Tests), auch bei Teilleistungsstörungen (z.B. Legasthenie)   Beratung bei Verhaltensauffälligkeiten, emotionalen Problemen (z.B. Angst), persönlichen Problemen , Entwicklungskrisen und psychosomatischen Problemen   Beratung bei schulischen Problemen und Essstörungen   Beratung bei Schwierigkeiten in der Ausbildung oder am Arbeitsplatz, sowie bei Schwierigkeiten mit Sekten und Problemen der Sinnfindung     Gruppenangebote:   Nürnberger Elterntraining (N.E.T.)  Bindungs- und Entwicklungsberatung (Safety - Geborgen bei mir) für Schwangere und junge Mütter/Eltern mit Säuglingen   Gruppen für Kinder im Kontext von Trennung und Scheidung   Soziale Kompetenzgruppen   Gruppen zur Förderung der Aufmerksamkeit   Gruppen für trauernde Kinder   ...    Die genannten Hilfen sind kostenfrei (Ausnahme: geringer Unkostenbeitrag beim Elterntraining und bei den Trennungs-Scheidungskinder-Gruppen), alle Mitarbeiterinnen und Mitarbeiter der Stelle unterliegen der gesetzlichen Schweigepflicht. Von Seiten der Ratsuchenden werden alle Hilfen freiwillig in Anspruch genommen     Eine Diplom-Psychologin der Stelle verfügt über perfekte Sprachkenntnisse in polnischer und russischer Sprache     Für die Klärung weiterer organisatorischer Fragen steht Ihnen unser Sekretariat (0911-2354241) zur Verfügung     Wir sind für alle Ratsuchenden, die mit minderjährigen Kindern und Jugendlichen zu tun haben offen, also für Eltern/Alleinerziehende, Erzieherinnen und Lehrkräfte und natürlich für die Kinder, Jugendlichen und jungen Erwachsenen selbst.     Bei der Online-Beratung müssen Sie natürlich nicht Ihre persönlichen Daten preisgeben, sondern können z.B. ein Pseudonym bzw. einen Nickname verwenden.  Zum Schutz der Mitarbeiterinnen und Mitarbeiter unserer Einrichtung arbeiten diese  mit den Pseudonymen Berater 1 bis Beraterin 6.  Bitte beachten Sie, dass Beraterin 5 prinzipiell nur freitags zur Verfügung steht, sowie Beraterin 2 von Montag bis einschließlich Donnerstag erreichbar ist. Beraterin 4 ist von Mittwoch bis Freitag ansprechbar.    Unsere Öffnungszeiten sind Montag bis Donnerstag von 9.00 - 12.00 und 14.00 - 16.00 Uhr sowie Freitag von 9.00 - 12.00.    Klienten aus Nürnberg können darüberhinaus bei Bedarf den Krisendienst Mittelfranken unter der zentralen Telefon-Nr. 0911 / 42 48 550 oder über das Internet www.krisendienst-mittelfranken.de erreichen.', '90403', 'Nürnberg', 0, 14, 0, null, 0, 11747, '2019-08-22 11:24:11', '2019-08-22 11:24:11', null, 3);
