INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (585, null, 'Erziehungsberatung / Familien- und Schulambulanz', 'Unser Fachteam aus einer Psychologin/Psychotherapeutin sowie DiplomsozialpädagogInnen hilft Ihnen    - wenn Sie in ihrer Erziehungsaufgabe Unterstützung suchen  - wenn Sie sich Sorgen wegen einer auffälligen Entwicklung Ihres Kindes machen  - wenn Sie Schulprobleme Ihres Kindes diagnostisch klären möchten  - wenn Ihr Kind von schwierigen Familiensituationen betroffen ist und Hilfe benötigt  - wenn Sie allgemeine oder spezielle Erziehungsfragen haben    Die in unserem Haus integrierte Familien- und Schulambulanz bietet Ihren Kindern ab dem Schulalter vielfältige Förder- und Therapiemöglichkeiten.  ', '46049', 'Oberhausen', 0, 14, 0, null, 0, 11906, '2019-08-22 11:24:11', '2019-08-22 11:24:11', null, 10);
