INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (822, null, 'Schwangerschaftsberatung SKF Wesel', 'Beratungs- und Öffnungszeiten: Mo - Do 8.00 - 16.30 Uhr, Fr 8.00 - 14.00 Uhr  Außensprechstunde Dinslaken: Mi 9.00 - 13.00 Uhr  Termine nach Vereinbarung    Beratung in Fragen     - rechtliche Probleme  - finanzielle Schwierigkeiten, Vermittlung finanzieller Hilfen durch die Bundesstiftung und den    bischöflichen Hilfsfonds  - Beziehungsprobleme  - Hilfe bei der Bewältigung des Alltags  - Sexualität und Familienplanung  - Trauerbegleitung nach Verlust eines Kindes    Wir beraten Sie kostenlos, auf Wunsch anonym, unabhängig von Nationalität und Konfession. Wir unterliegen der Schweigepflicht.    Weitere Angebote unserer Beratungstelle:    - jeden 3. Donnerstag im Monat treffen sich Schwangere und frisch gebackene     Eltern. Es besteht die Möglichkeit die Babys von einer Hebamme wiegen und messen zu lassen.     Bei Kaffee und Kuchen können sich die Eltern austauschen. Bei Bedarf sind Beratungs- und     Hebammenleistungen möglich.  - jeden 1. und 3. Mittwoch im Monat treffen sich Eltern mit ihren Kindern im Alter     zwischen 1  und 3 Jahren zur Spielgruppe.  - jeden 2. und 4. Dienstag im Monat bieten wir eine Gruppe für Schwangere zur  etwas     anderen  Vorbereitung auf das Leben mit Baby.  - jeden 2. und 4. Freitag treffen sich Eltern, Alleinerziehende und Familien      mit Kindern bis zum 3. Lebensjahr zum gemeinsamen Frühstück. Die Eltern können sich mit anderen     Eltern austauschen, die Kinder können erste soziale Kontakte knüpfen.        ', '46483', 'Wesel', 0, 2, 0, null, 0, 6175, '2019-08-23 06:52:05', '2019-08-23 06:52:05', null, 2);
