INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (824, null, 'Schwangerschaftsberatung Kleve', 'Wir beraten Sie kostenlos, auf Wunsch anonym, unabhängig von Nationalität und Konfession, vertraulich und unterliegen der Schweigepflicht.  Wir begleiten Sie mit Worten,um die Gedanken im Kopf zu ordnen und die Gefühle im Herzen zu verstehen,  und mit Taten, bei der Bewältigung Ihrer Alltagsprobleme, überall dort, wo Sie unsere Unterstützung brauchen.  Wir informieren und helfen, bei rechtlichen und finanziellen Problemen,  besprechen vorbehaltlos Ihre Fragen zu Sexualität und Familienplanung, vorgeburtlicher Vorsorge und Verlust Ihres Kindes und vermitteln Kontakte zu speziellen Beratungsdiensten oder Einrichtungen.', '47533', 'Kleve', 0, 2, 0, null, 0, 6181, '2019-08-23 06:52:05', '2019-08-23 06:52:05', null, 2);
