INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (1086, null, 'Caritasverband für die Stadt Recklinghausen e.V.', 'Beratungsstelle für ältere Menschen und ihre Angehörigen      Wir pflegen Menschlichkeit  - dieser Slogan beschreibt kurz und knapp, wer der Caritasverband für die Stadt Recklinghausen e. V. ist und was er macht.    Der Verband verfolgt ausschließlich gemeinnützige und mildtätige Zwecke. Das Wort Caritas kommt aus dem Lateinischen und bedeutet übersetzt Nächstenliebe, Wohltätigkeit und das ist es, was der CV Recklinghausen leistet.     Die Angebote und Dienste sind so vielfältig wie das Leben. Durch kompetente Hilfe und organisierte Dienste werden Menschen unabhängig ihrer Religion, Nationalität und Herkunft unterstützt, begleitet und beraten.  Ein ganz besonderes Augenmerk der Arbeit liegt in Hilfen und Angeboten für alte Menschen, Familien sowie Kinder und Jugendliche mit einer Behinderung.  Der Caritasverband für die Stadt Recklinghausen ist ein eingetragener Verein mit mehr als 600 Mitarbeitern, mehr als 30 Fachdiensten und Einrichtungen im Stadtgebiet und ist Teil des Diözesancaritasverbandes Münster.   Er bietet Familienhilfe, Hilfen für junge Menschen mit Behinderung, Seniorenhilfe und Beratungsdienste.   Der Bereich Hilfen für ältere Menschen beinhaltet die Beratungsstelle für ältere Menschen und pflegende Angehörige, die Caritas-Sozialstationen Nord und Süd, den Bereich Seniorenreisen, vier stationäre Einrichtungen - das Caritashaus Reginalda, das Caritashaus St. Michael, das Caritashaus St. Gertrudis und das Caritashaus St. Hedwig sowie Altenwohnungen.', '45659', 'Recklinghausen', 0, 7, 0, null, 0, 11060, '2019-08-23 07:07:10', '2019-08-23 07:07:10', null, 2);
