INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (1102, null, 'Alten- und Service-Zentrum Westend', 'Das Alten- und Service-Zentrum Westend ist...  ... Ihr Wegbegleiter im Alter, unabhängig von Konfession und Nationalität  ... eine Anlaufstelle für Seniorinnen und Senioren im Münchner Stadtteil Schwabing-West, sowie für deren Angehörige und andere Bezugspersonen, wenn sie Unterstützung, Beratung und Betreuung suchen  ... eine Einrichtung der Landeshauptstadt München in Betriebsführung des Caritasverbandes der Erzdiözese München und Freising e.V.    Die sozialpädagogischen Fachkräfte des ASZ Westendberaten Sie und Ihre Angehörigen gerne, damit Sie möglichst lange selbstständig und selbstbestimmt leben können.     Nutzen Sie unsere fachliche Kompetenz bei Fragen zu  - Hilfs- und Unterstützungsmöglichkeiten zu Hause (hauswirtschaftliche Hilfen, Hausnotruf, Essen auf Rädern, Begleitdienste etc.)  - der Vermittlung von ambulanten Pflegediensten sowie Tages- und Kurzzeitpflege  - Hilfs- und Unterstützungsmöglichkeiten im Bereich der Existenzsicherung und bei der Vermittlung an die Schuldnerberatung  - verschiedenen Wohnformen im Alter und Wohnraumberatung  - dem Umgang mit Behörden oder beim Ausfüllen von Anträgen und Formularen  - speziellen Themen rund ums Älterwerden (z.B. Patientenverfügung, Vorsorgevollmacht)  - persönlichen Anliegen in belastenden Lebenssituationen  - Vermittlung sowie Einsatzmöglichkeiten von ehrenamtlichen Helferinnen und Helfern    Die Beratung ist kostenlos.  Ihr Anliegen wird selbstverständlich vertraulich behandelt.  Hausbesuche sind bei Bedarf und nach Absprache möglich.  ', '80339', 'München', 0, 7, 0, null, 0, 11178, '2019-08-23 07:07:10', '2019-08-23 07:07:10', null, 19);
