INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (1104, null, 'Caritasverband für die Stadt Köln e.V.  - Seniorenberatung', 'Die Seniorenberaterinnen und Seniorenberater des Caritasverbandes helfen in vielen Bereichen und persönlichen Anliegen des täglichen Lebens.   Sie beraten in Fragen und zu Themen, die den Gesamtlebensraum älterer Menschen und deren Angehörige betreffen. Wir unterstützen Sie darin, möglichst lange ein eigenständiges und selbstbestimmtes Leben in der gewohnten Umgebung zu führen.   Für Ihre persönlichen Fragen haben wir ein offenes Ohr und beraten in Belastungs- und Konfliktsituationen.   Bei Bedarf vermitteln wir an spezialisierte Dienste und Einrichtungen.   Die Beratung ist vertraulich und kostenlos. Hausbesuche sind nach Vereinbarung möglich.', '51103', 'Köln', 1, 7, 0, null, 0, 11187, '2019-08-23 07:07:10', '2019-08-23 07:07:10', null, 1);
