INSERT INTO AGENCY (ID, TENANT_ID, NAME, DESCRIPTION, POSTCODE, CITY, IS_TEAM_AGENCY, CONSULTING_TYPE, IS_OFFLINE, URL, IS_EXTERNAL, ID_OLD, CREATE_DATE, UPDATE_DATE, DELETE_DATE, DIOCESE_ID) VALUES (1600, null, 'Schwangerschaftsberatung des Caritasverbandes Magdeburg', 'Die Schwangerschaftsberatungsstelle des Caritasverbandes für das Bistum Magdeburg e.V. berät Sie vor Ort in Magdeburg und hier auf diesen Online-Portal.  Wir beraten Frauen, Paare und Familien zu allen Fragen vor, während und nach der Schwangerschaft. Sie erhalten von uns ausführliche Informationen über gesetzliche Regelungen und finanzielle Hilfen. Sie bekommen Hilfe bei der Durchsetzung von Rechtsansprüchen. Für die Beantragung von Geldern aus der Bundesstiftung „Mutter und Kind – Schutz des ungeborenen Lebens“, „Familie in Not“ und der Stiftung „netzwerk leben“ stehen wir zur Verfügung.  Kostenlos, vertraulich und auf Wunsch auch anonym bieten wir Beratungen bei Fragen zu:  -          Schwangerschaft und Geburt  -          Schwangerschaftskonflikten  -          Sexualität, Verhütung, Partnerschaft und Familienplanung  -          Pränataldiagnostik und möglicher Behinderung des Kindes  -          Adoption  -          Vertraulicher Geburt  -          Betreuung nach Geburt, Fehl- und Totgeburt oder Schwangerschaftsabbruch  Die Beraterin verfügt über notwendige Grund- und entsprechende Zusatzqualifikationen und unterliegt der Schweigepflicht.    Schwangerschaftsberatung des Caritasverbandes Magdeburg  Karl-Schmidt-Str. 5 c  39104 Magdeburg  ', '39104', 'Magdeburg', 0, 2, 1, null, 0, null, '2020-03-24 05:41:46', '2020-03-24 05:41:46', null, 17);
